class Solution(object):
    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(num, target, op, res, curr, prev):
            if not num:
                if curr == target:
                    res.append(op)
                return
            for i in range(1, len(num) + 1):
                if i == 1 or num[0] != '0':
                    curr = int(num[:i])
                    if not op:
                        backtrack(num[i:], target, num[:i], res, curr, curr)
                    else:
                        backtrack(num[i:], target, op + '+' + num[:i], res, curr + prev, curr)
                        backtrack(num[i:], target, op + '-' + num[:i], res, curr - prev, -curr)
                        backtrack(num[i:], target, op + '*' + num[:i], res, curr * prev, curr)

        res = []
        backtrack(num, target, '', res, 0, 0)
        return res

