class Solution(object):
    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick(nums, k):
            result = []
            for i in range(len(nums)):
                if len(result) < k:
                    if nums[i] > result[-1]:
                        result.append(nums[i])
                else:
                    if nums[i] > result[-1]:
                        result.pop()
                        result.append(nums[i])
            return result

        def merge(nums1, nums2):
            result = []
            i, j = 0, 0
            while i < len(nums1) and j < len(nums2):
                if nums1[i] > nums2[j]:
                    result.append(nums1[i])
                    i += 1
                else:
                    result.append(nums2[j])
                    j += 1
            while i < len(nums1):
                result.append(nums1[i])
                i += 1
            while j < len(nums2):
                result.append(nums2[j])
                j += 1
            return result

        if len(nums1) < k:
            return nums2
        if len(nums2) < k:
            return nums1

        result = []
        for i in range(k):
            if len(nums1) - i > len(nums2) - k + i:
                result = merge(result, pick(nums1, len(nums1) - i))
            else:
                result = merge(result, pick(nums2, len(nums2) - i))
        return result

