class Solution(object):
    def firstUniqChar(self, s):
        """
        :type s: str
        :rtype: int
        """

        ## 1. Create a hashmap to store the frequency of each character in the string
        ## 2. Iterate through the string and for each character, check if it is in the hashmap
        ## 3. If it is, increment the frequency by 1
        ## 4. If it is not, add it to the hashmap with frequency 1
        ## 5. Iterate through the string again and return the index of the first character with frequency 1
        ## 6. If there is no character with frequency 1, return -1

        ## Time Complexity: O(n)
        ## Space Complexity: O(n)

        hashmap = {}

        for char in s:
            if char in hashmap:
                hashmap[char] += 1
            else:
                hashmap[char] = 1

        for i in range(len(s)):
            if hashmap[s[i]] == 1:
                return i

        return -1

