class Solution(object):
    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """

        if len(s) < len(t):
            return ""

        if len(s) == len(t):
            if s == t:
                return s
            else:
                return ""

        t_dict = {}
        for i in t:
            if i not in t_dict:
                t_dict[i] = 1
            else:
                t_dict[i] += 1

        s_dict = {}
        for i in s:
            if i not in s_dict:
                s_dict[i] = 1
            else:
                s_dict[i] += 1

        if t_dict == s_dict:
            return s

        left = 0
        right = 0
        min_len = len(s) + 1
        min_left = 0
        min_right = 0
        while right < len(s):
            if s[right] in t_dict:
                if s_dict[s[right]] < t_dict[s[right]]:
                    s_dict[s[right]] += 1
                else:
                    s_dict[s[right]] -= 1
            right += 1

            while s_dict[s[left]] > t_dict[s[left]]:
                s_dict[s[left]] -= 1
                left += 1

            if right - left < min_len:
                min_len = right - left
                min_left = left
                min_right = right

